import NavbarFreelancer from "../../components/navbar/NavbarFreelancer";
import AvailableJobs from "../../components/jobs/AvailableJobs";
import OngoingJobs from "../../components/jobs/OngoingJobs";
import Filter from "../../components/jobs/Filter";
import styles from './Dashboard.module.css'
import React, { useState, useEffect } from "react";
import axios from 'axios';


const DashboardFreelancer = () => {
  const [jobs, setJobs] = useState([]);

  useEffect(() => {
    const fetchJobs = async () => {
      try {
        const response = await axios.get('http://localhost:8001/jobs/getjobs');
        setJobs(response.data);
      } catch (error) {
        console.error("Error fetching jobs:", error);
      }
    };
  
    fetchJobs();
  }, []);

  


  return (
    <>
      <NavbarFreelancer/>
      <div className={styles.dashfree}>
 
        {jobs.map((job, index) => (
           <div key={index} className={styles.cards}>
           <h3 className={styles.title}> {job.title}</h3>
           <h3>Available Positions: {job.positionsAvailable}</h3>
           <h3>Skills Required: {job.skills}</h3>
           <h3>Job Type: {job.jobType}</h3>
           <h3>Duration: {job.duration}</h3>
           <h3>Salary: {job.salary}</h3>
           <button className={styles.delete} onClick={()=>handleApply(index)}>Apply</button>
         </div>
       ))}
      </div>
      
    </>
    
  );
};
export default DashboardFreelancer ;
